import React from "react";
import { emphasize, withStyles, makeStyles } from "@material-ui/core/styles";
import { AppBar, Toolbar, Breadcrumbs, Typography } from "@material-ui/core";
import Button from "@material-ui/core/Button";
import Link from "next/Link";

const useStyles = makeStyles(theme => ({
  root: {
    "& > *": {
      margin: theme.spacing(1)
    }
  },
  nav: {
    color: theme.palette.primary.contrastText,
    "text-decoration": "none",
    "&:hover, &:focus": {
      color: theme.palette.secondary.main,
      cursor: "pointer"
    }
  },
  title: {
    color: theme.palette.primary.contrastText,
    fontWeight: theme.typography.fontWeightMedium,
    flexGrow: 1
  }
}));

export default function Header(props) {
  const classes = useStyles();

  return (
    <AppBar>
      <Toolbar>
        <Button variant="outlined" className={classes.nav}>
          <Link href="/home" passHref>
            <Typography variant="subtitle">The Asterisk Lounge</Typography>
          </Link>
        </Button>
        <Button variant="outlined" className={classes.nav}>
          <Link href="/posts" passHref>
            <Typography variant="subtitle">Posts</Typography>
          </Link>
        </Button>
        <Typography variant="subtitle" className={classes.title}>
          Title
        </Typography>
        <Button variant="contained" color="secondary">
          Login
        </Button>
      </Toolbar>
    </AppBar>
  );
}
